// ================================
// إعدادات شعار الفاتورة
// ================================

// غيّر المسار فقط عند الحاجة
const INVOICE_LOGO_PATH = "data:image/png;base64,";

// تعيين الشعار عند تحميل الصفحة
document.addEventListener("DOMContentLoaded", () => {
  const logoImg = document.getElementById("invoiceLogo");

  if (!logoImg) {
    console.warn("❌ عنصر invoiceLogo غير موجود في الصفحة");
    return;
  }

  logoImg.src = INVOICE_LOGO_PATH;
});
